import { StyleSheet } from 'react-native';
import EditScreenInfo from '../components/EditScreenInfo';
import Frame from '../components/Frame';
import ScrollingFrame from '../components/ScrollingFrame';
import { Text, View } from '../components/Themed';
import { RootTabScreenProps } from '../types';

export default function TabOneScreen({ navigation }: RootTabScreenProps<'TabOne'>) {
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Tab One</Text>
      <View style={styles.separator} lightColor="#eee" darkColor="rgba(255,255,255,0.1)" />
      <EditScreenInfo path="/screens/TabOneScreen.tsx" />
      <ScrollingFrame size={100} gradient='linear-gradient(45deg, red, 50%, orange)' shadow={0.5} style={{ width: 100, height: 100, top: 0, left: 0, position: 'relative' }} numColumns={4} gridPadding={1}>
        <Frame radius={2} gradient='linear-gradient(45deg, pink, 50%, blue)' shadow={0.5} style={{ width: '10%', height: '25%', position: 'relative' }} />
      </ScrollingFrame>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: '80%',
  },
});
